import React from 'react';
import './App.css';
import {BrowserRouter as Router, Switch, Route} from "react-router-dom";
import Homepage from './components/Homepage';


function App() {

    return (
        <Router>
            <Switch>
                <Route path={"/home"} component={Homepage}/>
                <Route/>
            </Switch>
        </Router>
    );
}

export default App;
